import { Paper, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

export const Destinations = () => {
  return (
    <Box sx={{
        display: "flex",
        justifyContent: "center",
        height: "100vh"
    }}>
         <Box sx={{
            display: 'flex',
            flexWrap: 'wrap',
            '& > :not(style)': {
                width: 800,
                height: 700,
            },
        }}>
            <Paper elevation={6} />
        </Box>
    </Box>
  )
}
